import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  Typography,
  useTheme
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';

const Row = ({ pair, columns }) => {
  const [open, setOpen] = useState(false);
  const theme = useTheme();

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  return (
    <>
      <TableRow
        hover
        sx={{
          cursor: 'pointer',
          transition: 'all 0.2s',
          '& > td': {
            p: 2,
            border: 0,
            bgcolor: 'background.default',
            '&:first-of-type': {
              borderTopLeftRadius: 2,
              borderBottomLeftRadius: open ? 0 : 2,
            },
            '&:last-of-type': {
              borderTopRightRadius: 2,
              borderBottomRightRadius: open ? 0 : 2,
            }
          },
          '&:hover': {
            '& > td': {
              bgcolor: 'background.paper',
              boxShadow: 1,
            },
            '& .expand-icon': {
              color: 'primary.main',
              transform: open ? 'rotate(-180deg) translateY(-2px)' : 'rotate(0) translateY(-2px)',
            }
          },
          mb: 1,
        }}
        onClick={handleRowClick}
      >
        <TableCell>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <IconButton
              size="small"
              className="expand-icon"
              sx={{
                transition: 'all 0.2s',
                transform: open ? 'rotate(-180deg)' : 'rotate(0)',
                color: open ? 'primary.main' : 'text.secondary',
                mr: 1
              }}
            >
              <KeyboardArrowDownIcon />
            </IconButton>
            {/* First column content */}
            {columns[0].render ? columns[0].render(pair) : pair[columns[0].id]}
          </Box>
        </TableCell>
        {columns.slice(1).map((column) => (
          <TableCell
            key={column.id}
            align={column.numeric ? 'right' : 'left'}
          >
            <Box sx={{
              display: 'flex',
              alignItems: 'center',
              justifyContent: column.numeric ? 'flex-end' : 'flex-start',
              gap: 1
            }}>
              {column.highlight && (
                <Box
                  sx={{
                    px: 1,
                    py: 0.5,
                    borderRadius: 1,
                    bgcolor: pair.is_blacklisted ? 'error.lighter' : 'primary.lighter',
                    color: pair.is_blacklisted ? 'error.main' : 'primary.main',
                    fontWeight: 500,
                    fontSize: '0.875rem',
                  }}
                >
                  {column.render ? column.render(pair) : pair[column.id]}
                </Box>
              )}
              {!column.highlight && (
                <Typography
                  variant="body2"
                  sx={{
                    color: pair.is_blacklisted ? 'error.main' : 'text.primary',
                    fontWeight: column.bold ? 500 : 400
                  }}
                >
                  {column.render ? column.render(pair) : pair[column.id]}
                </Typography>
              )}
            </Box>
          </TableCell>
        ))}
      </TableRow>
      <TableRow>
        <TableCell
          colSpan={columns.length + 1}
          sx={{
            p: 0,
            border: 0,
            bgcolor: 'background.paper',
            borderBottomLeftRadius: open ? 2 : 0,
            borderBottomRightRadius: open ? 2 : 0,
          }}
        >
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ p: 3 }}>
              <ExpandedRow pair={pair} />
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  return (
    <TableContainer
      component={Paper}
      sx={{
        boxShadow: 2,
        borderRadius: 3,
        bgcolor: 'background.paper',
        p: 2,
        '& .MuiTable-root': {
          borderCollapse: 'separate',
          borderSpacing: '0 8px'
        }
      }}
    >
      <Table aria-label="pairs table">
        <TableHead>
          <TableRow
            sx={{
              '& th': {
                border: 0,
                p: 2,
                color: 'text.secondary',
                fontWeight: 600,
                fontSize: '0.75rem',
                textTransform: 'uppercase',
                letterSpacing: '0.05em',
                bgcolor: 'transparent'
              }
            }}
          >
            {columns.map((column, index) => (
              <TableCell
                key={column.id}
                align={column.numeric ? 'right' : 'left'}
                sortDirection={orderBy === column.id ? order : false}
                sx={{
                  cursor: 'pointer',
                  '&:hover': {
                    color: 'primary.main'
                  }
                }}
                onClick={() => handleSort(column.id)}
              >
                <TableSortLabel
                  active={orderBy === column.id}
                  direction={orderBy === column.id ? order : 'asc'}
                  sx={{
                    '& .MuiTableSortLabel-icon': {
                      opacity: 0.5
                    }
                  }}
                >
                  {index === 0 ? '' : column.label}
                </TableSortLabel>
              </TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {pairs.map((pair) => (
            <Row
              key={pair.address}
              pair={pair}
              columns={columns}
            />
          ))}
        </TableBody>
      </Table>
      <TablePagination
        rowsPerPageOptions={[10, 25, 50, 100]}
        component="div"
        count={totalCount}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        sx={{
          mt: 2,
          borderTop: 1,
          borderColor: 'divider',
          '& .MuiTablePagination-select': {
            bgcolor: 'background.default',
            borderRadius: 1,
            p: 1
          }
        }}
      />
    </TableContainer>
  );
};

export default PairsTable;
